                        fg.AppendLine("]");
                    }
                }
                fg.AppendLine("]");
            }
            if (printMask?.Targets?.Overall ?? true)
            {
                fg.AppendLine("Targets =>");
                fg.AppendLine("[");
                using (new DepthWrapper(fg))
                {
                    foreach (var subItem in item.Targets)
                    {
                        fg.AppendLine("[");
